CREATE TABLE estabelecimento (
  ID_estabelecimento INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
  nome VARCHAR(50) NOT NULL,
  foto BLOB NOT NULL,
  rua VARCHAR(60) NOT NULL,
  bairro VARCHAR(60) NOT NULL,
  numero INT NOT NULL
);

